        nodes = new vis.DataSet([{"color": "#377eb8", "id": "2012-2019_storby_1423", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMan m\u00e5 definitivt gj\u00f8re noe med utslippene fra luftfarten, og\u003cbr\u003edet vil bli svaert upopulaert dersom det vil koste mye mer \u00e5 dra p\u00e5\u003cbr\u003elanghelg ti\u003cb\u003el storby\u003c/b\u003eer eller p\u00e5 ferie til Thailand, sier han.\u003cbr\u003eMen b\u00e5de Kalbekken og Tveitdal peker p\u00e5 positive punkter i\u003cbr\u003esamarbeidserklaeringen, som utbygging av fornybar energi, \u00f8kning i\u003cbr\u003eavkastning fra milj\u00f8teknologifondet og l\u00f8ftet om ikke \u00e5 \u00e5pne for\u003cbr\u003epetroleumsvirksomhet utenfor Lofoten, Vester\u00e5len og Senja i\u003cbr\u003estortingsperiod\u003cspan style=\"color:#808080;\"\u003een.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_storby_1423\u003cbr\u003etype: usage\u003c/p\u003e", "x": -538.8892489917451, "y": 208.2004813678889}, {"color": "#377eb8", "id": "2012-2019_storby_1882", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEt liv uten stresset og maset i \u003cb\u003estorbyen\u003c/b\u003e gir rett og\u003cbr\u003eslett mer overskudd og produktivitet.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_storby_1882\u003cbr\u003etype: usage\u003c/p\u003e", "x": 155.61745987805077, "y": 572.5121080071112}, {"color": "#377eb8", "id": "1980-1990_storby_72", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eKartleggingen avbarnevernsbarnas sosiale bakgrunn i\u003cbr\u00 br\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_storby_4\u003cbr\u003etype: usage\u003c/p\u003e", "x": 281.3175345749922, "y": 124.24810575892444}, {"color": "#377eb8", "id": "1980-1990_storby_221", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI tettsteder er tal let 15 prosent, og i spredtbygd str\u00f8k var\u003cbr\u003edet bare 8 prosent av dem som reiste p\u00e5 sommerferie som brukte fly.\u003cbr\u003eForklaringen m\u00e5 vaere at en forholdsvis\u003cb\u003e sto\u003c/b\u003er andel av dem som\u003cbr\u003evar bosatt i storbyene og delvis i tettsteder i naerheten av disse\u003cbr\u003evalgte reisem\u00e5l s\u00e5 langt unna at bil var et uaktuelt transportmiddel.\u003cbr\u003e18 prosent av de ferierende fra storbyene reiste til S\u00f8r-Europa og\u003cbr\u003eandre fjerntliggende reisem\u00e5l, mens bare 5 prosent av\u003cbr\u003ereiselivsdeltakerne fra spredtbygde str\u00f8k av landet valgte slike\u003cbr\u003efjerne reisem\u00e5\u003cspan style=\"color:#808080;\"\u003el.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_storby_221\u003cbr\u003etype: usage\u003c/p\u003e", "x": -322.6830939322965, "y": 212.67620538869704}, {"color": "#377eb8", "id": "1980-1990_storby_207", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eTilsvarende fant Cullberg og Stephanssonienunders\u00f8kelse fra\u003cbr\u003eStockholm at tendensen til \u00e5 s\u00f8ke psykiatrisk hjelp var klart st\u00f8rst i\u003cbr\u003enye lavstatus omr\u00e5der i periferien av \u003cb\u003estorbyen\u003c/b\u003e (Cullberg \u0026amp;\u003cbr\u003eStephansson,l9Bl).\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003
